pragma solidity ^0.5.9;

import "./TokenUtils.sol";
import "../InterFaces/IWhiteList.sol";


contract RestrictedToken is TokenUtils {
    function checkBeforeTransfer(address _from, address _to)
        internal
        view
        returns (bool)
    {
        address whiteListAddress = getAddressOf(WHITE_LIST);

        if (_to != getAddressOf(SMART_SWAP)) {
            if (address(this) == getAddressOf(MAIN_TOKEN))
                require(
                    IWhiteList(whiteListAddress).main_isTransferAllowed(
                        _from,
                        _to
                    ),
                    "ERR_NOT_HAVE_PERMISSION_TO_TRANSFER"
                );
            else if (address(this) == getAddressOf(ETN_TOKEN))
                require(
                    IWhiteList(whiteListAddress).etn_isTransferAllowed(
                        _from,
                        _to
                    ),
                    "ERR_NOT_HAVE_PERMISSION_TO_TRANSFER"
                );
                //if(address(this) == getAddressOf(STOCK_TOKEN);)
            else
                require(
                    IWhiteList(whiteListAddress).stock_isTransferAllowed(
                        _from,
                        _to
                    ),
                    "ERR_NOT_HAVE_PERMISSION_TO_TRANSFER"
                );
        }
        return true;
    }
}
